import React, { useState } from "react";
import "../App.css";

function ProjectsDisplay() {
    const [activeProject, setActiveProject] = useState("project1");

    const projects = {
        project1: {
            name: "E-commerce System",
            content: "https://via.placeholder.com/600x400.png?text=E-commerce+System"  // Placeholder image for the e-commerce system project
        },
        project2: {
            name: "Mobile App",
            content: "https://via.placeholder.com/600x400.png?text=Mobile+App"  // Placeholder image for the mobile app project
        },
        project3: {
            name: "Machine Learning Model",
            content: "https://via.placeholder.com/600x400.png?text=Machine+Learning+Model"  // Placeholder image for the machine learning model project
        },
        project4: {
            name: "Data Visualization Project",
            content: "https://via.placeholder.com/600x400.png?text=Data+Visualization+Project"  // Placeholder image for the data visualization project
        }
    };

    return (
        <div className="flex-container">
            <div>
                <h1>Projects</h1>
                <ul>
                    <li onClick={() => setActiveProject("project1")}>E-commerce System</li>
                    <li onClick={() => setActiveProject("project2")}>Mobile App</li>
                    <li onClick={() => setActiveProject("project3")}>Machine Learning Model</li>
                    <li onClick={() => setActiveProject("project4")}>Data Visualization Project</li>
                </ul>
            </div>
            <div>

            </div>
        </div>

    );
}

export default ProjectsDisplay;
